import React, { Component } from 'react';
import './App.css';

class App extends Component {

  onSortEndImagesBis = (oldIndex, newIndex) => {
    this.setState({
      imagesBis: arrayMove(this.state.imagesBis, oldIndex, newIndex)
    });
  };

  onSortEndImages = (oldIndex, newIndex) => {
    this.setState({ images: arrayMove(this.state.images, oldIndex, newIndex) });
  };

  onSortEndNames = (oldIndex, newIndex) => {
    this.setState({ names: arrayMove(this.state.names, oldIndex, newIndex) });
  };

  render() {
    return (
      <div className="App">
        <h1 className="title">Argentina</h1>

      </div>
    );
  }
}

export default App;
